function UpdateDynamicStarMap{


#Looking for stones in the map array
for($j=($Script:MapArray.Length-1); $j -ge 0;$j--){

for($i=0;$i -lt ($Script:MapArray[$j].Length);$i++){

if($Script:MapArray[$j][$i] -eq 5.5){

if(  $j -ne ($Script:MapArray.Length-1)  ){

if( ($Script:MapArray[$j+1][$i] -eq 3) -or ($Script:MapArray[$j+1][$i] -eq 6)){

$Script:MapArray[$j][$i]=3
if($Script:MapArray[$j+1][$i] -eq 6){
$Script:CurStars++

if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}
else{
$Script:MapArray[$j+1][$i]=5.5
}

}

else{
$Script:MapArray[$j][$i]=5
}

if( (($Script:MapArray[$j][$i-1] -eq 3) -or ($Script:MapArray[$j][$i-1] -eq 6)) -and (($Script:MapArray[$j+1][$i-1] -eq 3) -or ($Script:MapArray[$j+1][$i-1] -eq 6))  -and (($Script:MapArray[$j+1][$i] -eq 5) -or ($Script:MapArray[$j+1][$i] -eq 4) ) ){
$Script:MapArray[$j][$i]=3
if($Script:MapArray[$j][$i-1] -eq 6){
$Script:CurStars++

if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}

else{
$Script:MapArray[$j][$i-1]=5.5
}

}

elseif( (($Script:MapArray[$j][$i+1] -eq 3) -or ($Script:MapArray[$j][$i+1] -eq 6)) -and (($Script:MapArray[$j+1][$i+1] -eq 3) -or ($Script:MapArray[$j+1][$i+1] -eq 6)) -and (($Script:MapArray[$j+1][$i] -eq 5) -or ($Script:MapArray[$j+1][$i] -eq 4)) ){
$Script:MapArray[$j][$i]=3
if($Script:MapArray[$j][$i+1] -eq 6){
$Script:CurStars++

if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}
else{
$Script:MapArray[$j][$i+1]=5.5}
$i++
}





}

else{
$Script:MapArray[$j][$i]=5
}



}
}
}

DrawMap
}




