#Hero sprite movement and win check function#


#Movement to the down side
function MoveDown {

#Check end of the map and barriers
if($Script:posY -lt ($Script:MapArray.Length-1)){
if(  ($Script:MapArray[$Script:posY+1][$Script:posX] -ne 2) -and ($Script:MapArray[$Script:posY+1][$Script:posX] -ne 4) -and (($Script:MapArray[$Script:posY+1][$Script:posX] -ne 0) -or ($Script:CurStars -ge $Script:StarToWin))  ){

#Check win event
if($Script:MapArray[$Script:posY+1][$Script:posX] -eq 0){

$Script:WinPict.Visible=$true
$Script:Won=1;
}

#Add star to the collection
if($Script:MapArray[$Script:posY+1][$Script:posX] -eq 5){
$Script:CurStars=$Script:CurStars+1

if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}

}

#Move Sprite
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posY=$Script:posY+1
$Script:MapArray[$Script:posY][$Script:posX]=6
DrawMap


}
}
};


#Movement to the up side
function MoveUp {

#Check end of the map and barriers
if($Script:posY -gt (0)){
if(($Script:MapArray[$Script:posY-1][$Script:posX] -ne 2) -and ($Script:MapArray[$Script:posY-1][$Script:posX] -ne 4) -and (($Script:MapArray[$Script:posY-1][$Script:posX] -ne 0) -or ($Script:CurStars -ge $Script:StarToWin))){

#Check win event
if($Script:MapArray[$Script:posY-1][$Script:posX] -eq 0){

$Script:WinPict.Visible=$true
$Script:Won=1;
}

#Add star to the collection
if($Script:MapArray[$Script:posY-1][$Script:posX] -eq 5){
$Script:CurStars=$Script:CurStars+1
if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}

#Move sprite
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posY=$Script:posY-1
$Script:MapArray[$Script:posY][$Script:posX]=6

DrawMap


}
}
};

#Movement to the left side
function MoveLeft{


#Check end of the map and barriers
if($Script:posX -gt 0){
if(($Script:MapArray[$Script:posY][$Script:posX-1] -ne 2) -and (($Script:MapArray[$Script:posY][$Script:posX-1] -ne 0) -or ($Script:CurStars -ge $Script:StarToWin)) ){

#Check win event
if($Script:MapArray[$Script:posY][$Script:posX-1] -eq 0){

$Script:WinPict.Visible=$true
$Script:Won=1;
}

#Add star to the collection
if($Script:MapArray[$Script:posY][$Script:posX-1] -eq 5){
$Script:CurStars=$Script:CurStars+1
if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}

#Move Sprite
if($Script:MapArray[$Script:posY][$Script:posX-1] -ne 4){
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posX=$Script:posX-1
$Script:MapArray[$Script:posY][$Script:posX]=6
}
else{
if($Script:MapArray[$Script:posY][$Script:posX-2] -eq 3){

$Script:MapArray[$Script:posY][$Script:posX-2]=4
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posX=$Script:posX-1
$Script:MapArray[$Script:posY][$Script:posX]=6

}

}


DrawMap

}
}
};

#Movement to the right side
function MoveRight{

#Check end of the map and barriers
if($Script:posX -lt ( ($Script:MapArray[$Script:PosY].Length)-1)){
if(($Script:MapArray[$Script:posY][$Script:posX+1] -ne 2) -and (($Script:MapArray[$Script:posY][$Script:posX+1] -ne 0) -or ($Script:CurStars -ge $Script:StarToWin))){

