$Script:CurStars=$Script:CurStars+1
if($Script:CurStars -ge $Script:StarToWin){$Script:ExitImage=$Script:ExitImageOpen}
}

if($Script:MapArray[$Script:posY][$Script:posX+1] -ne 4){
#Move Sprite
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posX=$Script:posX+1
$Script:MapArray[$Script:posY][$Script:posX]=6
}
else{
if($Script:MapArray[$Script:posY][$Script:posX+2] -eq 3){

$Script:MapArray[$Script:posY][$Script:posX+2]=4
$Script:MapArray[$Script:posY][$Script:posX]=3
$Script:posX=$Script:posX+1
$Script:MapArray[$Script:posY][$Script:posX]=6
}
}


DrawMap

}
}
