#Draw all elements of the map#
function DrawMap{
$Xnum=0;
foreach($line in $Script:MapArray){

foreach($column in $line){


if($column -eq 0){
 $Script:PictArray[$Xnum].Image=$Script:ExitImage
}

if($column -eq 1){
 $Script:PictArray[$Xnum].Image=$EarthImage
}

 if($column -eq 2){
 $Script:PictArray[$Xnum].Image=$WallImage
 }

  if($column -eq 3){
 $Script:PictArray[$Xnum].Image=$EmptyImage
 }

   if($column -eq 4){
 $Script:PictArray[$Xnum].Image=$StoneImage
 }
 
 if($column -eq 4.5){
  $Script:PictArray[$Xnum].Image=$StoneImage
 }
 
 
   if($column -eq 5){
 $Script:PictArray[$Xnum].Image=$StarImage
 }
 
    if($column -eq 5.5){
 $Script:PictArray[$Xnum].Image=$StarImage
 }
 
 if($column -eq 6){
 $Script:PictArray[$Xnum].Image=$Script:HeroImage
 }

$xnum=$xnum+1
}
}
}
